contracts/FundMe.sol.content:
// Get funds from users
// Withdraw funds
// Set a minimum funding value in USD
// Keep track of funders

// SPDX-License-Identifier: MIT

pragma solidity ^0.8.8;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

contract FundMe {
    
    // declaring minimun required amount in USD
    uint public minUsd = 50;

    function fund() public payable {
        require(msg.value >= minUsd, "Funding amount must be at least $50");
    }

    function getPrice() public view returns (int256) {
        // ABI
        // Address 	0x8A753747A1Fa494EC906cE90E9f37563A8AF630e
        AggregatorV3Interface priceFeed = AggregatorV3Interface(0x8A753747A1Fa494EC906cE90E9f37563A8AF630e);
        (, int256 price,,,) = priceFeed.latestRoundData();
        // ETH price in term of USD
        // Solidity doesn't returns decimals

        return price;
    }


}

